import React from "react";
import styled from "styled-components";
const Footer = () => {
  return (
    <FooterContainer className="main-footer">
      <div className="footer-middle">
        <div classNames="container">
          <div clasName="row" style={{ display: "flex" }}>
            {/* {column 1} */}
            <div className="col-md-3 col-sm-6 col-xs-4 ">
              <h4>lorem</h4>
              <ul className="list-unstyled">
                <li>
                  <a href="/"> Lorem ipsum </a>
                </li>
                <li>
                  <a href="/Home">Lorem ipsum </a>{"Home "}
                </li>
                <li>
                  <a href="/">Lorem ipsum </a>{" "}
                </li>
                <li>
                  <a href="/">Lorem ipsum </a>{" "}
                </li>
                <li>
                  <a href="/">Lorem ipsum </a>{" "}
                </li>
              </ul>
            </div>
            {/* {column 2} */}

            <div className="col-md-3 col-sm-6 col-xs-4">
              <h4>lorem</h4>
              <ul className="list-unstyled">
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
              </ul>
            </div>
            {/* {column 3} */}

            <div className="col-md-3 col-sm-6 col-xs-4">
              <h4>lorem</h4>
              <ul className="list-unstyled">
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
                <li>Lorem ipsum</li>
              </ul>
            </div>
            {/* {column 4} */}
          </div>
          {/* Footer bottom */}
          <div className="footer-bottom">
            <p className="text-xs-center">
              &copy;{new Date().getFullYear()} City Guide App - All Rights
              Reserved
            </p>
          </div>
        </div>
      </div>
    </FooterContainer>
  );
};

export default Footer;

const FooterContainer = styled.footer`
  .footer-middle {
    padding-top: 3rem;
    color: var(--mainWhite);
  }
  .footer-bottom {
    padding-top: 3rem;
    padding-bottom: 2rem;
  }
   {
    ul li a {
      color: var(--mainGrey);
      text-decoration: none;
    }
  }
  ul li a:hover {
    color: var(--mainLightGrey);
  }
`;
